import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonLabel, IonCheckbox, IonBadge, IonFab, IonFabButton, IonIcon, IonMenu } from '@ionic/react';
import React from 'react';
import { add } from 'ionicons/icons';
import { RouteComponentProps } from 'react-router';


const Home: React.FC<RouteComponentProps> = (props) => {
  return (
    <IonPage>
      <IonMenu contentId="menu" menuId="menu" swipeGesture={true}  >
        <IonHeader>
          <IonToolbar>
            <IonTitle>ToDO List RESTful</IonTitle>
          </IonToolbar>
        </IonHeader>
      </IonMenu>

      <IonContent>

        <IonList>
          <IonItem>
            <IonCheckbox slot="start" />

            <IonLabel>
              This is a not for example
            </IonLabel>
            <IonBadge color="warning" slot="end">
              Priority: 3
            </IonBadge>
          </IonItem>
        </IonList>

      </IonContent>

      <IonFab vertical="bottom" horizontal="end" slot="fixed">
        <IonFabButton>
          <IonIcon icon={add} />
        </IonFabButton>
      </IonFab>

    </IonPage>
  );
};

export default Home;
